{
    let input = '';

    const polimerLength = (input: string): number => {
        let reactionHappend = true;
        let units = input.split('').map(c => c.charCodeAt(0));

        while (reactionHappend) {
            reactionHappend = false;

            let i = 1;
            while (i < units.length && !reactionHappend) {
                if (Math.abs(units[i - 1] - units[i]) === 32) {
                    reactionHappend = true;
                    units.splice(i - 1, 2);
                }
                i++;
            }
        }

        return units.length;
    }

    const alphabet = 'abcdefghijklmnopqrstuvwxyz'.split('');

    const shortestPolimerLength = Math.min(
        ...alphabet
            .map(char =>
                polimerLength(input.replace(new RegExp("[" + char + String.fromCharCode(char.charCodeAt(0) - 32) + "]", 'g'), ''))
            )
    );

    console.log(shortestPolimerLength);
}